import React from "react";
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";
import Register from "./Register";
import Login from "./Login";

export default function App() {
  return (
    <BrowserRouter>
        <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/login">
            <Login />
          </Route>

        </Switch>
    </BrowserRouter>
  );
}
